  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Disaster Case Management Program
  (DCM) is a time-limited process that involves a partnership between a case manager
  and a disaster survivor (also known as a u201cclientu201d) to develop and carry
  out a Disaster Recovery Plan. This partnership provides the client with a single
  point of contact to facilitate access to a broad range of resources.</p>n<p>The
  DCM process involves:</p>n<p>u2022 Assessment of the clientu2019s needs caused by
  the disaster<br />nu2022 Development of a goal-oriented plan that outlines the steps
  necessary to achieve recovery<br />nu2022 Organization and coordination of available
  resources that match the clientu2019s needs<br />nu2022 Monitoring recovery plan
  goal progress<br />nu2022 Client advocacy if necessary</p>n\",\n\t\"license_title\":
